import { Link } from 'react-router-dom';

const Products = () => {
  return (
    <>
      <h1>Products Page</h1>
      <ul>
        <li>
          <Link to='/book'>A Book</Link>
        </li>
        <li>
          <Link to='/chair'>A Chair</Link>
        </li>
        <li>
          <Link to='/laptop'>A Laptop</Link>
        </li>
      </ul>
    </>
  );
};

export default Products;
